import React from 'react';


function Footer() {
    return (
        <footer>
            <h3 className="footer">
                <center>
                    <h2>Links</h2>
                <ul>
                | <a href="https://github.com/kjmckinley">GitHub</a> | 
                | <a href="www.linkedin.com/in/kyle-mckinley-87629b16a/">Linkedin</a> |
                | <a href="mailto:kj.mckinley@gmail.com">Email</a> | 
                | <a href="tel:5129446227">Cell</a> |
                </ul>
                <p>Made by Kyle</p>
                </center>

            </h3>
        </footer>
    )
}

export default Footer;
